package javabasicpart1;

/**
 * Write a Java program that takes two numbers as input and displays the product
 * of two numbers. Test Data: Input first number: 25 Input second number: 5
 * Expected Output : 25 x 5 = 125
 */
public class exersise5 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int num1 = 25;
		int num2 = 5;

		int output = num1 * num2;

		System.out.println(output);
	}

}
